	if !d.redis.Connected { 
		d.redis.Connect()
		_, err := d.redis.PingPong()
		if err != nil {
			if err != nil {
			}
		}
	}
	val, err := d.redis.GetBytes(sid)
	if err == nil {
		DeserializeBytes(val, &values)
	}

	return values

