func (h *cmdHandler) Handle() {
	args := os.Args
	if args == nil || len(args) < 2 {
		h.handleUsageError("Insufficient arguments")
		return
	} 
	key := args[1]
	cmdArgs := args[2:]
	h.HandleCmd(key, cmdArgs)
}

