type ScriptReloaderHandler struct{}

type ScriptInjectResponseWriter struct {
	http.ResponseWriter

	deferredStatus int
}

func (this ScriptInjectResponseWriter) WriteHeader(status int) {
	this.deferredStatus = status
}



func (this *ScriptReloaderHandler) ServeHTTP(res http.ResponseWriter, req *http.Request) {
	var data = make(map[string]interface{})

	data["PathSocket"] = dsconfig.Reloader.PathSocket
	data["PathXhr"] = dsconfig.Reloader.PathXhr
	data["WsAddress"] = fmt.Sprintf("%s:%d", dsconfig.Server.Host, dsconfig.Server.Port)
	data["XhrInterval"] = dsconfig.Reloader.XhrInterval

	var reloader bytes.Buffer

	tplReloader := template.New("reloader")
	tplReloader.Parse(dstpl.TplScript)
	tplReloader.Execute(&reloader, &data)

	content := reloader.Bytes()

	res.Header().Set("Content-Type", "text/javascript; charset=utf-8")
	res.Header().Set("Content-Length", strconv.FormatInt(int64(len(content)), 10))
	res.Write(content)
}

func NewScriptReloaderHandler() *ScriptReloaderHandler {
	return new(ScriptReloaderHandler)
}

func (this ScriptInjectResponseWriter) Write(data []byte) (int, error)

output:
{
	injectAt := 0
	content := string(data)

	if strings.Contains(content, "</head>") {
		injectAt = strings.Index(content, "</head>")
	} else if strings.Contains(content, "<html>") {
		injectAt = strings.Index(content, "<html>") + 6
	}

	if 0 < injectAt {
		content = fmt.Sprint(
			content[:injectAt],
			"<script src=\""+dsconfig.Reloader.PathScript+"\" type=\"text/javascript\"></script>",
			content[injectAt:],
		)
	}

	this.ResponseWriter.Header().Set("Content-Type", "text/html; charset=utf-8")
	this.ResponseWriter.Header().Set("Content-Length", strconv.FormatInt(int64(len(content)), 10))
	this.ResponseWriter.WriteHeader(this.deferredStatus)

	return this.ResponseWriter.Write([]byte(content))
}

