		fmt.Fprintf(fRstOutput, ".. list-table:: \n\n")
		table.Find("tr").Each(func(_ int, tr *goquery.Selection) {
			processTr(tr, fRstOutput)
		})
		fmt.Fprintf(fRstOutput, "\n\n")
