	for _, items := range s {
		for _, item := range items {
			if item == "" {
				continue
			}
			prefixes = append(prefixes, fmt.Sprintf("^%s", item))
		}
	}
	sort.Strings(prefixes)
	return strings.Join(prefixes, "|")
}

