		rename := regexp.MustCompile(`(?sU)<span id="lblIngName" class="ingredient-name">(.*)</span>`)

		for _, ingredient := range ingredients {
			amount := reamt.FindSubmatch(ingredient)
			name := rename.FindSubmatch(ingredient)

			item := ""

			if len(amount) > 1 {
				item = string(amount[1])
			}

			if len(name) > 1 {
				if item != "" {
					item += " "
				}

				item += string(name[1])
			}

			if item != "" {
