type ToRetry func() error 





func Do(retries int, sleep time.Duration, toRetry ToRetry) chan error

output:
{
	iteration := 1
	errs := make(chan error, retries)
	defer close(errs)

	err := toRetry()
	if err == nil {
		return errs
	}
	errs <- err

	for {
		select {
		case <-time.After(sleep):
			if iteration == retries {
				return errs
			}
			err := toRetry()
			if err != nil {
				errs <- err
			} else {
				errs := make(chan error, 0)
				close(errs)
				return errs
			}
			iteration++
		}
	}
	return errs
