type Printer struct {
	w    io.Writer
	name string
	prevWidth int
}



func (p *Printer) SetStatus(status Status) {
	s := fmt.Sprintf("\r%-45s %s", p.name, status)
	width := len(s)
	if p.prevWidth > width {
		s += strings.Repeat(" ", p.prevWidth-width)
	}
	p.prevWidth = width
	p.w.Write([]byte(s))
}



func (p *Printer) Done() {
	p.w.Write([]byte("\n"))
}



func (p *Printer) Clear() {
	p.w.Write([]byte("\r" + strings.Repeat(" ", p.prevWidth) + "\r"))
	p.prevWidth = 0
