		panic(fmt.Sprintf("error maxvalue: %v", maxvalue))
	}

	return &Dispatch{
		id:         make(chan int, idDefaultCount),
		duringLoad: make(chan int, 1),
		maxValue:   maxvalue,
		nowID:      idDefaultValue,
	}
}



