func main() {
	var target string
	fmt.Scan(&target)
	words := make([]string, 0, 100)
	for {
		var w string
		if _, err := fmt.Scan(&w); err != nil {
			break
		}
		words = append(words, w)
	}
	ans := Solve(target, words)
	for i, w := range ans {
		if i > 0 {
