	}
	fmt.Println()
}

func Solve(target string, words []string) (ans []string)

output:
{
	for _, w := range words {
		switch {
		case w == target:
			ans = append(ans, "["+w+"]")
		case strings.Contains(w, target):
			ans = append(ans, strings.Replace(w, target, "="+target+"=", -1))
		default:
			ans = append(ans, w)
		}
	}
	return
}

