func syncReadings(userId int, accessToken string) {
  readings := models.Readings()
  readmillReadings := readmillreadings.GetReadings(userId, accessToken)

  for _, readmillReading := range readmillReadings {
    title := readmillReading.Book.Title + " - " + readmillReading.Book.Author
    reading := models.GhReading{title, readmillReading.Id, 1}
    readings.Add(reading)
  }
