  tmpItems := make([]models.GhHighlight, len(highlights.Items))
  copy(tmpItems, highlights.Items)

  for _, highlight := range tmpItems {
    var highlightComment *readmillhighlights.HighlightComment
    if highlight.Comment != "" {
      highlightComment = &readmillhighlights.HighlightComment{highlight.Comment}
    }

    readmillHighlight := readmillhighlights.Highlight{highlight.Content,
      highlight.Position, highlight.Timestamp, readmillhighlights.HighlightLocators{}}

    success := readmillhighlights.PostHighlight(readmillHighlight, highlightComment, highlight.ReadingReadmillId, accessToken)

    if success {
