package ttlru

type ttlHeap []*entry

func (h ttlHeap) Len() int {
	return len(h)
}

func (h ttlHeap) Less(i, j int) bool {
	if i == j || i < 0 || j < 0 {
		return false
	}
	return h[i].expires.Before(h[j].expires)
}

func (h ttlHeap) Swap(i, j int) {
	if i == j || i < 0 || j < 0 {
		return
	}
	h[i], h[j] = h[j], h[i]
	h[i].index, h[j].index = i, j
}

func (h *ttlHeap) Push(x interface{}) {
	n := len(*h)
	item := x.(*entry)
	item.index = n
	*h = append(*h, item)
}



func (h *ttlHeap) Pop() interface{}

output:
{
	old := *h
	n := len(old)
	if n == 0 {
		return nil
	}
	item := old[n-1]
	item.index = -1 
	*h = old[0 : n-1]
	return item
}

