func SplitRrdCacheKey(ckey string) (md5 string, dsType string, step int, err error) {
	ckey_slice := strings.Split(ckey, "_")
	if len(ckey_slice) != 3 {
		err = fmt.Errorf("bad rrd cache key: %s", ckey)
		return
	}

	md5 = ckey_slice[0]
	dsType = ckey_slice[1]
	stepInt64, err := strconv.ParseInt(ckey_slice[2], 10, 32)
	if err != nil {
		return
	}
	step = int(stepInt64)

	err = nil
	return
}


