		if f.closed {
			return
		}

		go func() {
			for _ = range f.recv {
			}
		}()

		for w, _ := range f.Wizards {
			w.Close(true)
			delete(f.Wizards, w)
		}
		close(f.recv)
		f.closed = true
	})
}

