func (tp *ThreadPool) run() {
    tp.m.Lock()
    defer tp.m.Unlock()
    if tp.list.Len() > 0 && tp.running < tp.size {
        f := tp.list.Remove(tp.list.Front()).(func())
        tp.running++
        go func() {
            f()
            tp.onStop()
        }()
    }
}

func (tp *ThreadPool) Submit(f func()) {
    tp.list.PushBack(f)
    tp.run()
}

