func New() *Broker {
	b := &Broker{
		events: make(chan Event, 8),
		subs:   make(map[chan Event]string),
		sub:    make(chan sub),
		unsub:  make(chan sub),
	}

	go func() {
		for {
			select {
			case c := <-b.sub: 
				b.subs[c.events] = c.name
			case c := <-b.unsub: 
				delete(b.subs, c.events)
			case e := <-b.events: 
				for c := range b.subs {
					select {
					case c <- e:
					default:
					}
				}
			}
		}
	}()

	return b
}


func (b Broker) Subscribe(name string) chan Event {
	c := make(chan Event)
	b.sub <- sub{name: name, events: c}
