			runEvery = a.RunEvery
		}
		wait := time.After(s.SystemConf.GetCheckFrequency() * time.Duration(runEvery))
		s.checkAlert(a)
		s.LastCheck = utcNow()
		select {
		case <-wait:
		case <-s.runnerContext.Done():
			slog.Infof("Stopping alert routine for %v\n", a.Name)
			return
		}
	}
