	scanner := bufio.NewScanner(reader)
	for scanner.Scan() {
		fmt.Fprintf(r.outStream, "%s\n", scanner.Text())
	}
}

func (r *Runner) echoStderr(reader io.Reader) {
	scanner := bufio.NewScanner(reader)
	for scanner.Scan() {
		fmt.Fprintf(r.errStream, "%s\n", scanner.Text())
	}
}

