package leader

import (
	"time"

	log "github.com/Sirupsen/logrus"
)

type poller struct {
	leaderChan   chan Leadership
	pollInterval time.Duration
	tick         <-chan time.Time
	stop         chan struct{}
	pollFunc     CheckLeaderFunc
}


func NewPoller(pollInterval time.Duration, f CheckLeaderFunc) Detector {
	return &poller{
		pollInterval: pollInterval,
		tick:         time.Tick(pollInterval),
		pollFunc:     f,
	}
}


func (l *poller) Start() (<-chan Leadership, error) {
	if l.leaderChan != nil {
		return l.leaderChan, nil
	}

	l.leaderChan = make(chan Leadership)
	l.stop = make(chan struct{})

	go l.poll()
	return l.leaderChan, nil
}




func (l *poller) poll() {
	for {
		select {

		case <-l.tick:

			isLeader, err := l.pollFunc()
			event := Leadership{}
			if err != nil {
				event.Status = Unknown
				event.Error = err
			} else {
				if isLeader {
					event.Status = Leader
				} else {
					event.Status = NotLeader
				}
			}

			l.leaderChan <- event

		case <-l.stop:
			log.Infoln("Stopping leadership check")
			close(l.leaderChan)
			l.leaderChan = nil
			l.stop = nil
			return
		}
	}
}

func (l *poller) Stop()

output:
{
	if l.stop != nil {
		close(l.stop)
	}
}

