		return true
	}
	if a == '(' && b == ')' {
		return true
	}
	if a == '{' && b == '}' {
		return true
	}
	return false
}

func isValid(s string) bool {
	arr := []byte(s)
	stack := new(Stack)
	for _, c := range arr {
		switch c {
